import React, { useState } from "react";
import CytoscapeComponent from 'react-cytoscapejs';

const SecondStage = () => {
    const elements = [
        { data: { id: 'one', label: 'Node 1' }, position: { x: 0, y: 0 } },
        { data: { id: 'two', label: 'Node 2' }, position: { x: 100, y: 0 } },
        { data: { source: 'one', target: 'two', label: 'Edge from Node1 to Node2' } }
     ];
    return <div className="d-flex flex-column">
                 <p className="w-100">
                    <h1 class="display-6">Этап 2: Задайте переходы между эмоциями</h1>
                </p>
                <div>
                    <form>
                        <label>Количество ответов</label>
                        <input id="example" type="text" name="label"></input>
                        <label>Откуда</label>
                        <input type="text" name="source"></input>
                        <label>Куда</label>
                        <input type="text" name="target"></input>
                        <button type="submit" class="btn btn-primary" onclick="myFunction()">Добавить ребро</button>
                    </form>
                </div>

                <CytoscapeComponent elements={elements} style={ { width: 80, height: '500px' } } />;


            </div>

}
export default SecondStage;
